import React, { Component } from "react";
import ButtonBase from "../../ButtonBase"
import ButtonBaseProps from "../../ButtonBase"

interface LoginButtonProps extends ButtonBaseProps {
  // No se necesitan props adicionales
}

class LoginButton extends Component <LoginButtonProps> {

  render() {
    // Utiliza las props de ButtonBase para renderizar el botón
    return (
      <ButtonBase
        /*onClick = {this.props.onClick}*/
        style = {{
          backgroundColor: "red",
          color: "white",
          fontSize: "1rem",
          fontWeight: "bold",
        }}
      >
       Entrar
      </ButtonBase>
    );
  }
}

export default LoginButton;
